import * as React from 'react';
import { StyledMenu } from './menu.styled';
import Logo from '../logo';
import Link from 'next/link';
import { Home } from 'styled-icons/icomoon/Home';
import { UserDetail } from 'styled-icons/boxicons-solid/UserDetail';
import { GraduationCap } from 'styled-icons/fa-solid/GraduationCap';
import { Books } from 'styled-icons/icomoon/Books';
import { Work } from 'styled-icons/material/Work';
import { Slideshow } from 'styled-icons/remix-fill/Slideshow';
import { Heart } from 'styled-icons/boxicons-solid/Heart';
import { ContactMail } from 'styled-icons/material/ContactMail';

const Menu = ({ open }) => {
  return (
    <StyledMenu open={open}>
      <Logo></Logo>
      <ul>
        <li>
          <Link href="#home">
            <span>{Home}</span>Inicio
          </Link>
        </li>
        <li>
          <Link href="#about">Sobre mi</Link>
        </li>
        <li>
          <Link href="#education">Educacion</Link>
        </li>
        <li>
          <Link href="#skills">Habilidades</Link>
        </li>
        <li>
          <Link href="#experience">Experiencia</Link>
        </li>
        <li>
          <Link href="#portfolio">Portafolio</Link>
        </li>
        <li>
          <Link href="#interest">Intereses</Link>
        </li>
        <li>
          <Link href="#contact">Contactame</Link>
        </li>
      </ul>
    </StyledMenu>
  );
};
export default Menu;
